import React from 'react'
import s from './MyPosts.module.css'
import Post from './Post/Post'

const MyPosts = (props) => {


    let postElements = Posts.map(post => <Post theme={props.myPosts.theme} content={props.myPosts.content} likeCount={props.myPosts.likeCount} />)

    return (
        <div className={s.all_posts}>
            <h2 className={s.news_title}>Мои новости</h2>

            { postElements }
            {/*нет новостей*/}
        </div>
    )
}

export default MyPosts
